import './AddNewChatMenu.css';

const ProgressMenu = () => {

    return (
        <div className="pnl_addNewChatMenu">
        <h1 className="txt_CreateNewChat">Create new chat</h1>
            <div className="div_addNewChatMenu">
            <h1 className="txt_CreateGroupName">Create Groupchat Name:</h1>
            <input className='txtbox_CreateChatName' placeholder='Type Name Here...' />
            <button className='btn_CreateChatMenu'>Create</button>
            </div>       
        </div> 
    );
}

export default ProgressMenu;
